Mongo NodeJS project() is not a function<p>I wanted to exclude some attributes from the result. I read the specification: <a href="https://docs.mongodb.com/manual/tutorial/project-fields-from-query-results/" rel="noreferrer">https://docs.mongodb.com/manual/tutorial/project-fields-from-query-results/</a> - I need to use <code>project</code> function. So I chained this call but the code starts failing. The code worked fine without <code>.project({ auth: 0, prefs: 0, consent: 0 })</code>. Where is the issue? I found this answer which looks similar: <a href="https://stackoverflow.com/a/51732851/1639556">https://stackoverflow.com/a/51732851/1639556</a>.</p>

<p>package.json</p>

<pre><code>"mongodb": "^3.4.1",
</code></pre>

<p>Lambda</p>

<pre><code>exports.handler = (payload, context, callback) =&gt; {
    const userId = payload.pathParameters.userId;
    context.callbackWaitsForEmptyEventLoop = false;   
    mongo.connectToDatabase()
        .then(db =&gt; {
            return findUser(db, userId);
        })
        .then(user =&gt; {
            console.log("User fetched");
        })
};

function findUser(dbClient, userId) {
    return dbClient.db()
        .collection("users")
        .findOne({ "_id": userId })
        .project({ auth: 0, prefs: 0, consent: 0 })
        .then(doc =&gt; { return doc; });
}
</code></pre>

<p>Error</p>

<pre><code>2020-01-28T11:52:34.555Z        0701f485-3770-1f43-f838-4baec8377293    INFO    Request failed TypeError: dbClient.db(...).collection(...).findOne(...).project is not a function
at findUser (/var/task/src/handlers/users/getUser.js:41:10)
at mongo.connectToDatabase.then.db (/var/task/src/handlers/users/getUser.js:19:20)
</code></pre>

<p>PS I am curious if the projection is done at client side or server side. It is confusing to me that the <code>project</code> function is AFTER the <code>find</code> call.</p>

