Adding an element to a list in a MongoDB Document using Java<p>I am a little confused as to how to add an element to an array in an exisiting mongodb document, or why my results are not showing properly and how I expect.</p>

<p>There is only one document in the collection and will only ever be one. The mongo document looks like when I do a <code>db.collection-name.find.pretty()</code> command in a mongo session on the command line:</p>

<pre><code>{
    "_id" : ObjectID("1234567890"),
    "details" : {
        ...
    },
    "calculations" : [
        {
            "count" : 1,
            "total" : 10,
            "mean" : 2.5
        },
        {
            "count" : 2,
            "total" : 20,
            "mean" : 6.4
        }
    ]
}

</code></pre>

<p>I want to add another object to the <code>calculations</code> list.</p>

<p>The Java code I am running is based upon <a href="https://stackoverflow.com/questions/44865878/appending-data-to-array-in-mongodb-document-using-java-driver-3-4">THIS</a> example:</p>

<pre><code>// Get the database and collection
MongoDatabase database = mongo.getDatabase(dataBaseName);
MongoCollection&lt;Document&gt; collection = database.getCollection(collectionName);
Document document = collection.find().first(); // will only ever be one document 

// The object comes in as a Map
Map&lt;String, Object&gt; incomingMap = new HashMap&lt;&gt;();
incomingMap.put("count", 3);
incomingMap.put("total", 4);
incomingMap.put("mean", 7.9);
// convert to a Document
Document newDocument = new Document();
incomingMap.forEach((k, v) -&gt; {
        newDocument.append(k, v);
});

// append this to the collection - this is where I am confused
// for this example just hardcoding the _id value for simplicity
collection.updateOne(new Document("_id", "1234567890"), Updates.push("calculations", newDocument));
</code></pre>

<p>However when I do a <code>System.out.println(collection.find().first())</code> in the code after this or <code>db.collection-name.find.pretty()</code> in a mongo session the new document has not been added. There are no errors thrown and completes fine. </p>

<p>What I am wondering is</p>

<ul>
<li>Is the line <code>collection.updateOne(new Document("_id", "1234567890"), Updates.push("calculations", newDocument));</code> correct?</li>
<li>Has it been added but not been saved - if so how do I save? </li>
<li>Can I do this at a document level, for example <code>document.update(new Documen(Updates.push("calculations", newDocument));</code> or similar?</li>
<li>I have also tried <code>collection.findAndUpdateOne(new Document("_id", "1234567890"), Updates.push("calculations", newDocument));</code> with the same result</li>
<li>Is how I am getting/hardcoding the document ID incorrect? </li>
</ul>

