How can I get mongo documents with multiple non-exclusive selectors using Mongoose?<p>I need to build a single query to return :</p>

<ul>
<li>Documents from their IDs (optional)</li>
<li>Documents matching a text search string (optional)</li>
<li>The other documents sorted by score and with a count limited by an integer argument</li>
</ul>

<p>The total limit is the provided one + the length of the documents array IDs of the first condition. </p>

<p>I used to work with meteor where you can return an array of queries cursors. In this case, I am working with a mongoose backend and I am not sure of how to proceed. I assume I need to use <code>Model.aggregate</code> and provide my conditions as an array. However, the request fails with the error <code>Arguments must be aggregate pipeline operators</code>.</p>

<p>Each of my conditions works fine individually with a regular <code>find()</code> query. </p>

<p>Here is my graphQL query resolver, where I can't find what is going wrong:</p>

<pre class="lang-js prettyprint-override"><code>              async (root, { search, selected = 0, limit = 10 }, { models: { tag } }) =&gt; {
               try {
                   let selector = [{}] // {} should return the documents by default if no other condition is set
                   if (selected.length) selector.push({ _id: { $in: selected } })
                   if (search &amp;&amp; search.length) selector.push({
                       $text: {
                           $search: search,
                           $caseSensitive: false,
                           $diacriticSensitive: false
                       }
                   })

                   const tags = await tag.aggregate(selector).sort('-score').limit(limit + selected.length)

                   return {
                       ok: true,
                       message: "Tags fetched",
                       data: tags
                   }
               } catch (err) { return { ok: false, message: err.message }; }
           }
       ),
</code></pre>

<p>When I log the selector with all the arguments set, it returns an array of the following form:</p>

<pre class="lang-js prettyprint-override"><code>[
  {},
  { _id: { '$in': [Array] } },
  {
    '$text': {
      '$search': 'test',
      '$caseSensitive': false,
      '$diacriticSensitive': false
    }
  }
]
</code></pre>

<hr>

<p><strong>UPDATE</strong></p>

<p>Based on @Ashh answer, with an additional <code>$or</code> operator, the full agregator variable look like this:</p>

<pre><code>   {
    '$match': {
      '$or': {
        _id: {
          '$in': [ '5e39745e0ac14b1731a779a3', '5e39745d0ac14b1731a76984' ]
        },
        '$text': {
          '$search': 'test',
          '$caseSensitive': false,
          '$diacriticSensitive': false
        }
      }
    }
  },
  { '$sort': { score: -1 } },
  { limit: 12 }
</code></pre>

<p>I still get the "Arguments must be aggregate pipeline operators" error, and I don't see where, if the <code>$text</code> argument is not present, I get the default documents by score. </p>

<p>@Ashh, I'll wait for your updated answer to validate it. Thanks again for your help.</p>

